  constructor() {
    super();
    this.state = {
      displayTop: "test",
      displayBot: 0,
    };
  }

  handleClick(obj) {
    console.log(obj.id + obj.name);
    return obj;
  }

  render() {
    return (
      <div id="container">
        <div id="displayTop">{this.state.displayTop}</div>
        <div id="display">{this.state.displayBot}</div>
        <Button onClick={this.handleClick(obj)} />
      </div>
    );
  }
}
export default App;
